webpackJsonp([0xa49de82b10bc],{8060:function(t,a){t.exports={data:{post:{html:"<p>I haven't blogged much about this year's presidential campaign. But I'm going to put my money where my mouth is.</p>\n<p>I've just donated one month's advertising proceeds from PapaScott to the <a href=\"http://www.barackobama.com/\">Obama</a> campaign. My Text Link Ads are fully booked, so it's not an insignificant amount.</p>\n<p>However, it's not as significant as a single vote. If you are eligible to vote in this election, please do so.</p>",fields:{title:"PapaScott for Obama",date:"28 Oct 2008",url:"https://papascott.de/2008-10-28-papascott-for-obama/"}}},pathContext:{slug:"/2008-10-28-papascott-for-obama/",prev:{fields:{title:"Easy Morning in Words and Pictures",date:"22 Oct 2008",slug:"/2008-10-22-easy-morning-in-words-and-pictures/"}},next:{fields:{title:"If I Had A Pony",date:"29 Oct 2008",slug:"/2008-10-29-if-i-had-a-pony/"}}}}}});
